function add(a, b) {

    let add = a + b;
    return add;

}
function sub(a, b) {
    let sub = a - b;
    return sub;
}
function div(a, b) {
    let div = a / b;
    return div;

}
function mul(a, b) {
    let mul = a * b;
    return mul;

}

export default {add, sub, mul, div};
